    { id: 3, name: 'Anaya Hussain', age: 3, },
    { id: 4, name: 'Shakir hussain', age: 32, }
]
const contaxt = useContext()
function CompA() {
    return (
        <div>
            <contaxt.provider>
                <CompB />
            </contaxt.provider>

        </div>
    )
}
